  true,\n\t\"url\": null,\n\t\"notes\": \"The RSS Monthly 1-deg Merged Wind Climatology
  netCDF dataset provides one degree gridded data for the monthly means of wind speed
  and wind direction, a 20 year climatology file, and a cumulative file from 1988
  to the current month.   This includes the anomalies for global winds over Ice Free
  Oceans (60S to 60N) and the tropical mean for 20S to 20N.  Satellite informaSSMI
  (8, 10, 11, 13, 14,15) and SSMIS (16, 17), AQUA10 and Windsat(Coriolis). This dataset
  contains both netCDF3 and netCDF4 formatted files.\",\n\t\"license_title\": \"U.S.
